javascript:
frappe.call({
    "method": "pg_management.api.get_available_rooms",
    args: {
    },
    callback: function(r){
        if(r.message){
           $.each(r.message, function(i, d) {
                $("#avl_rooms").append("<tr> \
                    <td>"+d['name']+"</td> \
                    <td>"+d['sharing']+"</td> \
                    <td>"+d['room_rent']+"</td> \
                </tr>")
           })
        }
    }
})
